def minWindow(s, t):
    """
    :type s: str
    :type t: str
    :rtype: str
    """        
    
    minlen = 2147483649
    res= ""
    
    pool = list(t)
    targ = set(t)
    if s:
        stack = []
        index = []        
        for i in range(len(s)):                
            if s[i] in targ:
                stack.append(s[i])
                index.append(i)           
                j = len(stack)-1
                while pool and j>=0:
                    if stack[j] in pool:
                        pool.remove(stack[j])
                    j -= 1                            
                if not pool:
                    if minlen>index[-1]-index[j+1]+1:
                        minlen = index[-1]-index[j+1]+1
                        res = s[index[j+1]:index[-1]+1]
                    while index and index[-1]-index[0]+1>=minlen:
                        index.pop(0)
                        stack.pop(0)
                        
                pool = list(t)                    
                            
    return res             

import collections                
def minWindow2(s, t):
    """
    :type s: str
    :type t: str
    :rtype: str
    """        
    
    minlen = 2147483649
    res= ""
    begin, end = 0, -1
    
    if s:
        targ = {}
        for ch in t:
            if ch not in targ:
                targ[ch] = 1
            else:
                targ[ch] += 1
        
        counter = {}  
        stack = collections.deque()
        first = False
        for i in range(len(s)):
            if s[i] in targ:
                stack.append((s[i], i))
                if s[i] not in counter:
                    counter[s[i]] = 1
                else:
                    counter[s[i]] += 1
                while counter[stack[0][0]]>targ[stack[0][0]]:
                    counter[stack[0][0]] -= 1
                    stack.popleft()
                if counter[stack[0][0]]==targ[stack[0][0]]:
                    if not first:
                        found = True
                        for ch in targ.iterkeys():
                            if ch not in counter or counter[ch]<targ[ch]:
                                found = False
                        if found:
                            if minlen>i-stack[0][1]+1:
                                minlen = i-stack[0][1]+1
                                begin = stack[0][1]
                                end = i
                            first = True
                    else:
                        if minlen>i-stack[0][1]+1:
                            minlen = i-stack[0][1]+1
                            begin = stack[0][1]
                            end = i
                        
        res = s[begin:end+1]
            
    return res   
    
